import React from 'react';
import logo from './logo.svg';
import './Main.css';

import {
  Switch,
  Route,
} from 'react-router-dom';

const pages = [
  {id: 1, title: 'Lorem', path: '/'},
  {id: 2, title: 'Ipsum', path: '/ipsum'},
  {id: 3, title: 'Dolor', path: '/dolor'},
  {id: 4, title: 'Sit Amet', path: '/sit-amet'}
]

function Main() {
  const page = pages.map((page) =>
    <Route path={page.path} >
      <h2>{page.title}</h2>
    </Route>
  );

  return (
      <Switch>
	<Route path='/ipsum' >
      	  <h2>Ipsum</h2>
    	</Route>
	<Route path='/dolor' >
      	  <h2>Dolor</h2>
    	</Route>
	<Route path='/sit-amet' >
      	  <h2>Sit Amet</h2>
    	</Route>
	<Route path='/' >
      	  <h2>Lorem</h2>
    	</Route>
      </Switch>
  );
}

export default Main;
